import { Squash as Hamburger } from "hamburger-react";

const Menubutton = () => {
  <div id="menu-button" className>
    <Hamburger
      color="#000"
      size={24}
      onToggle={(toggled) => {
        if (toggled) {
          // open a menu
          document
            .getElementById("filter-dropdown")
            .classList.remove("invisible");
        } else {
          // close a menu
          document.getElementById("filter-dropdown").classList.add("invisible");
        }
      }}
    />
  </div>;
};

export default Menubutton;
